import ProfilePhoto from './Profile_Photo.jpg'
import HomePageText from './HomePageText';

function HomePage (){
    return (<div>
        <img src={ProfilePhoto} alt = 'Will Profile Picture'/>
        <HomePageText></HomePageText>
    </div>)
}

export default HomePage;
